import React from "react";

function AGEBInfo({ ageb }) {
  // Handle initial state when no polygon is selected
  if (!ageb) {
    return (
      <div className="ageb-info">
        <h2>Neighborhood Information</h2>
        <p>Select a point on the map to view neighborhood details.</p>
      </div>
    );
  }

  // Destructure properties from ageb.properties
  const {
    CVEGEO,
    salud_count,
    deportivos_count,
    educacion_count,
    guarderias,
    infraestructura_count,
    pp_count,
    comercios_count,
  } = ageb.properties;

  return (
    <div className="ageb-info">
      <h2>Neighborhood Information</h2>
      <p>
        CVEGEO: {CVEGEO}
        <br />
        Salud Count: {salud_count}
        <br />
        Deportivos Count: {deportivos_count}
        <br />
        Educacion Count: {educacion_count}
        <br />
        Guarderias: {guarderias}
        <br />
        Infraestructura Count: {infraestructura_count}
        <br />
        PP Count: {pp_count}
        <br />
        Comercios Count: {comercios_count}
        <br />
      </p>
    </div>
  );
}

export default AGEBInfo;
